          "id": "17fbf433251a3f2ccc1593b8992e70c098d744f9",
          "message": "Add snap-to geometry (#636)\n\nAdd exposure for `SnapToGeometry` objects.\r\n\r\nFor the `OrientationType`, the `UNKNOWN` option does not really make sense: it is\r\nequivalent to `BOTTOM` in terms of how it's handled in the backend.\r\nHowever, since existing models may use the `UNKNOWN` value, I decided to nevertheless\r\nexpose it in PyACP, but with a leading underscore, and mentioning in the doc that it should\r\nnot be used.\r\nThe alternative would be to convert it to the `BOTTOM` value in the conversion between\r\nPyACP enums and protobuf; however, I think this could be confusing when the model\r\ndefinition is different in PyACP vs. the ACP GUI.\r\n\r\n---------\r\n\r\nCo-authored-by: Ren Roos <105842014+roosre@users.noreply.github.com>",
