          "message": "Convert path to positional argument (#654)\n\nConvert the `path` from a keword-only argument to a positional\r\nargument in the import and export methods.\r\n\r\nThis is motivated mostly by the `import_model` method, where\r\nthe path is the only required argument. As such, it's intuitive\r\nto call the function with the path as positional argument.\r\n\r\nThe other export methods (solid model export and solid model\r\nskin export) are adapted for consistency.\r\nFor the model export methods, the `path` was already a positional\r\nargument, so no changes were needed.\r\n\r\nCo-authored-by: Ren Roos <105842014+roosre@users.noreply.github.com>",
