          "message": "Model / feature tree printing: set 'show_lines' default to False (#837)\n\nChange the 'show_lines' parameter default to False in the model\nand feature tree printing functions. The reason for this is\nthat some of the line characters are not representable in\nWindows-1252 encoding, which will cause an exception when this\nencoding is used for printing.\n\nAdapt the documentation to instead pass the 'show_lines=True'\nparameter explicitly.\n\nMake the 'to_string' method of the Node class public, to allow\npassing the 'show_lines' parameter to it. Otherwise, the tree\nwithout lines could only be printed, not obtained as a string.",
