          "id": "0c5ff77874428d7d7634948796fd905f3b951ce6",
          "message": "Add section cut export methods (#850)\n\nAdd methods `export` and `export_becas_input` to the `SectionCut` class.\n\nThe two export types (CDB / BECAS) are implemented as separate methods to mirror the API, rather than in the same method like in ACP scripting.\nCombining them would be tricky because their signatures are completely different:\n- the `path` argument is expected to be a filename for CDB export, and a directory for BECAS export\n- their effect is also distinct: CDB export creates one file, BECAS export creates multiple\n- they have distinct _additional_ keyword arguments (this alone would be manageable)\n\nTo enable the multiple-file export, an additional parameter `is_directory` is added to the `FileTransferStrategy.to_export_path` interface.\n\nThe `auto_download` context manager cannot be used in the multi-file export context. Its logic is reimplemented / adapted directly in `export_becas_input`. If / once there are multiple such cases, we may want to either extend `auto_download`, or add an alternative context manager which directly supports it.\n\nCloses #770.",
          "timestamp": "2025-05-21T19:46:23Z",
          "tree_id": "57f91308b3d6b6059085cf1a923a65c1fa7002f2",
