          "id": "f51ebb15822e132efb5dff5418f39e3d0756242c",
          "message": "Implement gRPC transport options (#918)\n\nFor each launch mode, implement the gRPC transport options which are applicable:\n- `direct`, `connect` and `connect_local`: mTLS, UDS (Unix only), WNUA (Windows only), and insecure\n- `docker_compose`: mTLS and insecure\n\nThe corresponding options are added to the launch configuration dataclasses, and then\nconverted to the (mode-specific) transport options classes provided by `ansys-tools-local-product-launcher`.\n\nWhen the server is unpatched, only the `insecure` transport mode is accepted, the others\nraise an error (either when launching the server, or when attaching). One exception is\nWNUA in `connect` or `connect_local` mode, since there's no way for the client to distinguish\nit from `insecure` mode (the check is purely server-side).\n\nWith a patched server, the direct launch mode should work out of the box without code changes.\n\nAdd documentation for how to change the gRPC transport mode when launching ACP.",
